import React, { useEffect, useState } from "react";
import { userProfile } from "../../api";
import "../../assets/Style/addprofile.css";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import LoadingSpinner from "../loading_spinner";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleRight } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from "react-router-dom";

const InterestMatching = () => {
  const [formValues, setFormValues] = useState({
    accordion1: "",
    accordion2: "",
    accordion3: "",
    accordion4: "",
    accordion5: "",
    accordion6: "",
    accordion7: "",
  });
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();
  const [token, setToken] = useState(null);
  const [userId, setUserId] = useState(null);

  useEffect(() => {
    setToken(localStorage.getItem("token"))
    setUserId(localStorage.getItem("userId"))
    setFormValues((prevValues) => ({
      ...prevValues,
    }));
  }, []);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormValues((prevValues) => ({
      ...prevValues,
      [name]: value,
    }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    const invalidAccordions = Object.values(formValues).some((value) => value === "");
    if (invalidAccordions) {
      toast.error("Please fill in all the accordions", { autoClose: 2000 });
      return;
    }

    setIsLoading(true);

    try {
      const profileData = formValues;

      await userProfile(userId, token, profileData);

      toast.success("Profile added", { autoClose: 2000 });
      navigate("/interestmatching"); // Redirect to "/interestmatching"
    } catch (error) {
      toast.error("Error creating profile", { autoClose: 2000 });
    }

    setIsLoading(false);
  };

  return (
    <div className="user-info layout-container">
      <form>
        <div className="accordion">
          <h2>Accordion 1</h2>
          <select
            name="accordion1"
            value={formValues.accordion1}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 2</h2>
          <select
            name="accordion2"
            value={formValues.accordion2}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 3</h2>
          <select
            name="accordion3"
            value={formValues.accordion3}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 4</h2>
          <select
            name="accordion4"
            value={formValues.accordion4}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 5</h2>
          <select
            name="accordion5"
            value={formValues.accordion5}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 6</h2>
          <select
            name="accordion6"
            value={formValues.accordion6}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <div className="accordion">
          <h2>Accordion 7</h2>
          <select
            name="accordion7"
            value={formValues.accordion7}
            onChange={handleChange}
            required
          >
            <option value="">Select option</option>
            <option value="Option 1">Option 1</option>
            <option value="Option 2">Option 2</option>
            <option value="Option 3">Option 3</option>
            <option value="Option 4">Option 4</option>
            <option value="Option 5">Option 5</option>
          </select>
        </div>

        <button
          className="submit-button"
          onClick={handleSubmit}
          disabled={isLoading}
        >
          {isLoading ? <LoadingSpinner /> : <FontAwesomeIcon icon={faAngleRight} />}
        </button>
      </form>
      <ToastContainer />
    </div>
  );
};

export default InterestMatching;
